Dzień dobrym, mam do sprzedania samochód osobowy marki Audi 4 wyprodukowany w 1998 roku, który został wyposażony w silnik benzynowy, doposażony w instalacje LPG (butla ważna do 2031) o pojemności 1595 cm3, legitymujący się mocą 100 KM, który pokonał do tej pory 320000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Audi prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane.



A4 jest wyposażenia w:

- Klimatyzacje;

- Elektryczne szyby przednie;

- Elektrycznie regulowane lusterka;

- ABS;

- Centralny zamek;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 22.10.2025 roku.

Przegląd techniczny 22.04.2025 roku.

